#include <stdio.h>

int minOperations(int* nums1, int nums1Size, int* nums2, int nums2Size) {
    int maxNums1 = nums1[0], maxNums2 = nums2[0];
    for (int i = 1; i < nums1Size; ++i) {
        if (nums1[i] > maxNums1) {
            maxNums1 = nums1[i];
        }
        if (nums2[i] > maxNums2) {
            maxNums2 = nums2[i];
        }
    }

    int operations = 0;
    if (nums1[nums1Size - 1] != maxNums1 || nums2[nums2Size - 1] != maxNums2) {
        int needSwap1 = nums1[nums1Size - 1] != maxNums1;
        int needSwap2 = nums2[nums2Size - 1] != maxNums2;

        if (needSwap1 && nums2[nums1Size - 1] == maxNums1) operations++;
        if (needSwap2 && nums1[nums2Size - 1] == maxNums2) operations++;

        if ((needSwap1 && nums2[nums1Size - 1] != maxNums1) || 
            (needSwap2 && nums1[nums2Size - 1] != maxNums2)) {
            return -1;
        }
    }

    return operations;
}
